Queens of the Stone Age - Go with the Flow [MTV Unplugged, 2005].VOB


HQ rare promo music video from a promo DVD. &quot;Go with the Flow&quot; is a song by Queens of the Stone Age from the album Songs for the Deaf, released as a single in 2003. At the 46th Grammy Awards, the song was nominated for Best Hard Rock Performance.

MTV Unplugged is a TV series showcasing many popular musical artists usually playing acoustic instruments. The show has received the George Foster Peabody Award and 3 Primetime Emmy nominations among many accolades.

The underlying concept behind the Unplugged series has been attributed to the popularity among musicians of a variety of informal musical performances on stage, film, television and record in earlier decades. The casual &quot;in-the-round&quot; sequence in Elvis Presley's 1968 Comeback Special, and The Beatles' informal studio jams documented in the 1970 film Let It Be were both precursors of the &quot;Unplugged&quot; concept, though they were neither conceived nor promoted as such at the time they occurred.

Queens of the Stone Age is an American rock band from Palm Desert, California, United States, formed in 1996. The band's line-up includes founder Josh Homme (lead vocals, guitar, piano), alongside longtime members Troy Van Leeuwen (guitar, lap steel, keyboard, percussion, backing vocals), Michael Shuman (bass guitar, keyboard, backing vocals), Dean Fertita (keyboards, guitar, percussion, backing vocals), and recent addition Jon Theodore (drums, percussion).

Formed after the dissolution of Homme's previous band, Kyuss, Queens of the Stone Age developed a style of riff-oriented, heavy rock music. Their sound has since evolved to incorporate a variety of different styles and influences, including working with ZZ Top member Billy Gibbons and steady contributor Mark Lanegan.
